('9c3f59f5-7696-4e45-96b8-d8bbca9cdb9e',
 '123e4567-e89b-12d3-a456-426614174000',
 'Assistant: What''s been on your mind lately? I''m here to help you explore your thoughts.
User: Today I was working and I found out that a colleague is leaving! I''m close with them, probably the closest colleague I have. I emphasise having a good work-life balance, but it still sucks to see someone I like from the work side move on. I hope I cross paths with them again in future.
Assistant: I can understand how that must feel. Losing a close colleague can be quite difficult, even if it''s part of the natural ebb and flow of work. It''s understandable to feel a sense of sadness or loss, even when you try to maintain a healthy work-life balance. What has been most meaningful about your relationship with this colleague? How do you hope your paths may cross again in the future? Sharing your reflections on the positive aspects of this connection could help provide some comfort during this transition.',
